import React from "react";
import { Header } from "./Components/Header";
import { Sections } from "./Components/Sections";
import { Stories } from "./Components/Stories";
import { Footer } from "./Components/Footer";

const WealthSense = () => (
  <>
    <Header />
    <Sections />
    <Stories />>
    <Footer />
  </>
);

export default WealthSense;
